import banner from './Portfolio_Banner.png';

class Home extends Component {
  render(){
  return (
    <div>
      <h1>Home page/ about</h1>

      <img src={banner} alt ="Banner">
      <Transformation width="250" height="250" gravity="faces" crop="fill" />
      </img>
      < br />
    </div>
  );
  }
}

export default Home;
